class Solution {
  int maximumSetSize(List<int> nums1, List<int> nums2) {
    final totalLength = nums1.length + nums2.length;
    final countMap = <int, int>{};
    nums1.forEach((num) => countMap[num] = (countMap[num] ?? 0) + 1);
    nums2.forEach((num) => countMap[num] = (countMap[num] ?? 0) + 1);
    final counts = countMap.values.toList()..sort((a, b) => b.compareTo(a));
    var removeCount = nums1.length ~/ 2;
    var uniqueCount = 0;
    for (var count in counts) {
      if (removeCount > 0) {
        var minCount = count ~/ 2;
        if (minCount > 0) {
          if (removeCount >= minCount) {
            removeCount -= minCount;
          } else {
            minCount = removeCount;
            removeCount = 0;
          }
          count -= minCount * 2;
        }
      }
      if (count > 0) uniqueCount++;
    }
    return uniqueCount;
  }
}
